sources.styles/blocks/page.scss:
.page {
  font-family: "Poppins", sans-serif;
  background-color: #1d1d1d;

  scroll-behavior: smooth;

  &__body {
    margin: 0;

    &--with-menu {
      overflow: hidden;
    }
  }

  &__menu {
    position: fixed;
    top: 0;
    left: 0;
    right: 0;

    transform: translateX(100%);
    transition: transform 0.5s;

    &:target {
      transform: translateX(0);
    }
  }

  &__section {
    margin-bottom: 92px;
    color: #fff;

    @include onDesktop {
      margin-bottom: 150px;
    }
  }

  &__section-title {
    margin: 0 0 48px;

    font-weight: 500;
    font-size: 32px;
    line-height: 32px;

    text-align: center;
    letter-spacing: -1.5px;

    @include onDesktop {
      font-size: 64px;
      line-height: 64px;
    }

    @include onTablet {
      font-size: 48px;
    }
  }
}

sources.styles/_mixins.scss:
@mixin onDesktop {
  @media (min-width: 1024px) {
    @content;
  }
}

@mixin onTablet {
  @media (min-width: 744px) {
    @content;
  }
}

@mixin addShakingAnimation {
  animation-name: move;
  animation-duration: 0.1s;
  animation-iteration-count: 3;
}

@mixin top-actions {
  display: flex;
  justify-content: space-between;
  align-items: center;
}

