sources.styles/blocks/detail.scss:
.detail {

  &__photo-container {
    position: relative;
    margin: 0 0 16px;

    box-sizing: border-box;
    width: 100%;
    padding-bottom: 100%;
    max-height: 130px;
    overflow: hidden;

    &::after {
      content: "";
      display: block;
      padding-bottom: 100%;
    }

    @include onDesktop {
      max-height: 321px;
      padding-bottom: 0;
    }

    @include onTablet {
      max-height: 187px;
      padding-bottom: 0;
    }
  }

  &__photo {
    position: absolute;
    width: 100%;
    height: 100%;

    object-fit: cover;
    object-position: center;

    transition: transform $transitionTime;

    &:hover {
      transform: scale(1.2);
    }
  }

  &__name {
    margin: 0 0 8px;

    font-weight: 700;
    font-size: 24px;
    line-height: 34px;
  }

  &__description {
    font-weight: 400;
    font-size: 16px;
    line-height: 22px;
  }
}

sources.styles/blocks/button.scss:
.button {
  display: flex;
  justify-content: center;
  align-items: center;

  box-sizing: border-box;
  width: 100%;
  height: 56px;
  background-color: #fff;
  border-radius: 40px;

  font-weight: 700;
  font-size: 16px;
  line-height: 27px;
  color: #1d1d1d;
  text-decoration: none;
  transition: all $transitionTime;

  &:hover {
    cursor: pointer;
    box-shadow: 1px 4px 16px rgba(232, 232, 240, 0.4);

    letter-spacing: +1.5px;

    @include addShakingAnimation;
  }

  &:active {
    box-shadow: 1px 4px 16px rgba(232, 232, 240, 0.64);
  }
}

