sources.styles/blocks/form-field.scss:
.form-field {
  box-sizing: border-box;
  display: block;

  padding: 14px 16px;

  height: 48px;
  width: 100%;

  border: 3px solid transparent;
  border-radius: 40px;

  background: #f8f8fa;
  color: #292929;

  transition: all $transitionTime;

  &::placeholder {
    font-weight: 400;
    font-size: 14px;
    line-height: 20px;
    color: #7e7e83;
  }

  &:hover {
    border-color: #ccd0e0;
    box-shadow: 1px 4px 16px rgba(232, 232, 240, 0.4);

    &::placeholder {
      color: #000;
    }
  }

  &:focus {
    border-color: #ccd0e0;
    outline: none;
  }

  &--textarea {
    font-family: inherit;
    height: 148px;
    resize: none;
    border-radius: 16px;
  }
}

